import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./components//Home/Homepage";
import UserRoute from "./components/User Dashboard/UserRoute";
import Dashboard from "./components//User Dashboard/UserDashboard";
import AdminRoute from "./components/AdminRoute";
import AdminDashboard from "./components/AdminDashboard";
import AgentDashboard from "./components/AgentDashboard";
import AgentRoute from "./components/AgentRoute";
// Test component
import WebSocketTest from "./components/[TEST]websocket";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route
          path="/user-dashboard"
          element={
            <UserRoute>
              <Dashboard />
            </UserRoute>
          }
        />
        <Route
          path="/agent-dashboard"
          element={
            <AgentRoute>
              <AgentDashboard />
            </AgentRoute>
          }
        />
        <Route
          path="/admin-dashboard"
          element={
            <AdminRoute>
              <AdminDashboard />
            </AdminRoute>
          }
        />
        <Route path="/test-websocket" element={<WebSocketTest />} />
      </Routes>
    </Router>
  );
}

export default App;
